import {connect} from 'react-redux';
import * as Actions from '../actions';
import App from '../App';

const mapStateToProps = state => ({
    whosOnFirst: state.whosOnFirst,
    time : state.time,
    teamMembers: state.teamMembers
  });
  const mapDispatchToProps = (dispatch, ownProps) => ({
    changeTMList: () => dispatch({type: Actions.changeTMList, value: ownProps}),
    updateTimer: () => dispatch({type: Actions.changeTimeDelta, value: ownProps}),
    updateTM: () => dispatch({type:Actions.changeTeamMember, value: ownProps}),
    changeCircle: () => dispatch({type:Actions.changeCircle, value: ownProps})

  });

  export default connect(
    mapStateToProps,
    mapDispatchToProps,
  )(App);
